import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  const handleComponentChange = (componentName) => {
    // Make a request to Flask API using the relative URL path
    fetch(`/get_component/${componentName}`) // Using a relative path
      .then((response) => response.json())
      .then((data) => {
        const { component } = data;
        if (component) {
          console.log(`Rendering ${component}`);
          // Logic to render the component based on the data received from Flask API
          // You might use conditional rendering or state management to render the fetched component
        }
      })
      .catch((error) => {
        console.error('Error fetching component data:', error);
      });
  };

  return (
    <header className="bg-dark">
      <nav className="navbar navbar-expand-lg navbar-dark">
        <div className="container">
          <Link to="/" className="navbar-brand">Integrity Protection & Consulting Corp.</Link>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
            aria-controls="navbarNav"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav ms-auto">
              <li className="nav-item">
                <button className="nav-link" onClick={() => handleComponentChange('home')}>
                  Home
                </button>
              </li>
              <li className="nav-item">
                <button className="nav-link" onClick={() => handleComponentChange('about')}>
                  About
                </button>
              </li>
              <li className="nav-item">
                <button className="nav-link" onClick={() => handleComponentChange('services')}>
                  Services
                </button>
              </li>
            </ul>
          </div>
        </div>
      </nav>
    </header>
  );
}

export default Header;
